function change(dsy, s, v){
    var str="0";
    for(i=0;i<v;i++){
        str+=("_"+(document.getElementById(s[i]).selectedIndex-1));
    };
    var ss=document.getElementById(s[v]);
    with(ss){
        length = 0;
        options[0]=new Option(opt0[v], "");
        if(v && document.getElementById(s[v-1]).selectedIndex>0 || !v){
            if(dsy.Exists(str)){
                ar = dsy.Items[str];
                for(i=0;i<ar.length;i++){
                    var optItem = ar[i].split('-');
                    options[length]=new Option(optItem[1],optItem[0]);
                }//end for
                if(v){ options[0].selected = true; }
            }
        }//end if v
        if(++v<s.length){change(dsy, s, v);}
    }//End with
}

function _init_area(dsy, dsy_name, s, s_name, opt0){  //初始化函数
    for(i=0;i<s.length-1;i++){
        var function_name = "change("+dsy_name+","+s_name+","+(i+1)+")";
        document.getElementById(s[i]).onchange=new Function(function_name);
    }
    change(dsy, s, 0);
}